import Grid from './Grid'
import List from './List'

const Card = (props) => {

    console.log(props)

    const moded = props.showListGrid
    let listItems

    if(moded) {

        let enAtt = props.students.map((student) => ( <List student={student} key={student.id}/> ))

        listItems = <table className="list">   
                        <tr>
                            <th></th>
                            <th>id</th>
                            <th>Image</th>
                            <th>First name</th>
                            <th>Last name</th>
                            <th>Spécialité</th>
                        </tr>
                        {enAtt}
                    </table>
    }else {
        listItems = props.students.map((student) => ( <Grid student={student} key={student.id}/> ))
    }

    return (
        <div className="container">{listItems}</div>
    )
}

export default Card
